import React from 'react'

const PesquisaGrad = () => {

    const navigate = useNavigate();

  return (
    <div className='container'>
      <p className='display-6 mt-4'><strong>Pesquisa - Graduação</strong></p>
      <p>Para submeter seu trabalho, você primeiro deve estar inscrito como ouvinte</p>
      <p>Caso ainda não esteja inscrito, <a href="#" onClick={() => navigate("/inscrições")}>clique aqui</a> para se inscrever.</p>
    </div>
  )
}

export default PesquisaGrad
